import React from "react";
import Layout from "../../components/layout";
import { Tabs, TabList, TabPanels, Tab, TabPanel } from "@chakra-ui/react";
import PlayerList from "../../components/playerList";

const Team = ({ players, coaches }) => {
  console.log({ players, coaches });
  const d1 = players.filter((player) => (player.division = "D1"));
  const d3 = players.filter((player) => (player.division = "D3"));
  return (
    <Layout header="Players">
      <Tabs variant="enclosed">
        <TabList>
          <Tab>Bombers DI</Tab>
          <Tab>Bombers DIII</Tab>
          <Tab>Coaches and Staff</Tab>
        </TabList>
        <TabPanels>
          <TabPanel>
            <PlayerList list={d1}></PlayerList>
          </TabPanel>
          <TabPanel>
            <PlayerList list={d3}></PlayerList>
          </TabPanel>
          <TabPanel>
            <PlayerList list={coaches}></PlayerList>
          </TabPanel>
        </TabPanels>
      </Tabs>
    </Layout>
  );
};

export default Team;
